import { Link } from 'react-router-dom';
import styles from './MainNav.module.css';
import CartContext from '../../store/CartContextProvider';
import { useContext } from 'react';
import { useAuth0 } from "@auth0/auth0-react";
function MAinNav() {
  const {cartLength,cart}=useContext(CartContext)
  const { loginWithRedirect } = useAuth0();
  const { logout,isAuthenticated,user } = useAuth0();




  return (

    <div>

    <nav className={styles.nav}>
    <ul>
        <li><Link to="/"><i class="fa-solid fa-burger"></i> React Foods</Link></li>
        <li><Link to="/mycart"><i class="fa-solid fa-cart-shopping"></i> Cart{isAuthenticated&&cartLength!=0&&<sup>{cartLength}</sup>}</Link></li>


        {!isAuthenticated&& <li><button onClick={() => loginWithRedirect()}>Log In</button></li>}
       { isAuthenticated&&  <li> <button onClick={() => logout({ logoutParams: { returnTo: window.location.origin } })}>
      {user.name}
    </button></li>}

    </ul>


</nav>

{isAuthenticated&&<div className="toast z-3 position-absolute" role="alert" aria-live="assertive" aria-atomic="true">
  <div class="toast-header">

    <strong class="me-auto">Bootstrap</strong>
    <small>11 mins ago</small>
    <button type="button" class="btn-close" data-bs-dismiss="toast" aria-label="Close"></button>
  </div>
  <div className="toast-body">
    Hello, world! This is a toast message.
  </div>
</div>
}
</div>

  );
}

export default MAinNav;
